    true,nt"url": null,nt"notes": "<p>This release contains the Basic Stand
    Alone (BSA) Home Health Agency (HHA) Beneficiary Public Use Files (PUF) with information
    from Medicare HHA claims. The CMS BSA HHA Beneficiary PUF is a beneficiary-level
    file in which each record is a beneficiary who had at least one HHA claim from a
    random 5 percent sample of Medicare beneficiaries. There are some demographic and
    claim-related variables provided in this PUF.</p>n",nt"license_title": "Other
